let queryTimeRange = toscalar(Perf
| summarize interval = (max(TimeGenerated)-min(TimeGenerated))
| project interval);
let bin_size = (tr: timespan){
    case(
        tr <= 1h, 1m,
        tr <= 24h, 10m,
        1h
        )
};
let binSize = bin_size(queryTimeRange);
let capacityCounterName = 'memoryLimitBytes';
let usageCounterName = 'memoryRssBytes';
let containerWebApi = "account-management-webapi" ;
Perf
| where InstanceName endswith containerWebApi
| where ObjectName == 'K8SContainer'
| where CounterName == capacityCounterName
| summarize LimitValue = max(CounterValue) by InstanceName, CounterName, bin(TimeGenerated, binSize)
| project InstanceName, CapacityStartTime = TimeGenerated, CapacityEndTime = TimeGenerated + binSize, LimitValue
| join (
  Perf
  | where InstanceName endswith containerWebApi
  | where ObjectName == 'K8SContainer'
  | where CounterName == usageCounterName
  | project InstanceName, UsageValue = CounterValue, TimeGenerated
) on InstanceName
| project InstanceName, TimeGenerated, UsagePercent = UsageValue * 100.0 / LimitValue
| summarize UsagePercent = avg(UsagePercent) by bin(TimeGenerated, binSize), InstanceName
| render timechart

